import React from 'react';

function AuthModal({ type, onLogin, onRegister, onClose }) {
  return (
    <div className="auth-modal">
      <h2>{type === 'login' ? '로그인' : '회원가입'}</h2>
      {/* 로그인/회원가입 폼을 여기에 구현 */}
      <button onClick={onClose}>닫기</button>
    </div>
  );
}

export default AuthModal;
